import React from 'react';

import classes from './signIn.module.css';

function SignIn(props){
    return(
        <div>
            <form>
                <input
                type="text"
                placeholder='Enter mobile number'
                maxlength="10" 
                required>
                </input>
                <button type = "button">CONTINUE</button>
            </form>
        </div>
    );
}

export default SignIn;
